define({"topics" : [{"title":"Install the Snowflake Stage Library","shortdesc":"\n                  <p class=\"shortdesc\">You must install the Snowflake stage library before using the Snowflake destination.         The Snowflake stage library includes\n                     the Snowflake JDBC driver that the destination uses to         access Snowflake.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Destinations\/Snowflake.html#concept_ghg_k3q_jgb","attributes": {"data-id":"concept_ghg_k3q_jgb",},"menu": {"hasChildren":true,},"tocID":"concept_ghg_k3q_jgb-d46e110236","next":"concept_ghg_k3q_jgb-d46e110236",},{"title":"Create a Snowflake External Stage","shortdesc":"\n                  <p class=\"shortdesc\">To write data to Snowflake, the Snowflake destination stages data to one of the         Snowflake cloud service providers,\n                     Amazon S3 or Microsoft Azure. Before using the         destination in a pipeline, you must create a Snowflake external stage.\n                     \n                  </p>\n               ","href":"datacollector\/UserGuide\/Destinations\/Snowflake.html#concept_uyn_dqj_2gb","attributes": {"data-id":"concept_uyn_dqj_2gb",},"menu": {"hasChildren":false,},"tocID":"concept_uyn_dqj_2gb-d46e110365","topics":[]},{"title":"Snowpipe Prerequisites","href":"datacollector\/UserGuide\/Destinations\/Snowflake.html#concept_nzd_mgj_2gb","attributes": {"data-id":"concept_nzd_mgj_2gb",},"menu": {"hasChildren":false,},"tocID":"concept_nzd_mgj_2gb-d46e110431","topics":[]}]});